import React, { Component } from "react";
import CardItem from "../CardItem";
import "./HomepageRegisteredUser.css";
import { withStyles } from '@material-ui/core/styles';

import Dialog from '@material-ui/core/Dialog';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Typography from '@material-ui/core/Typography';
import authService from '../services/auth.service';
import Form from "react-validation/build/form";
import Input from "react-validation/build/input";
import CheckButton from "react-validation/build/button";
import { Card, Button } from 'react-bootstrap';

const required = value => {
  if (!value) {
    return (
      <div className="alert alert-danger" role="alert">
        This field is required!
      </div>
    );
  }
};

const styles = (theme) => ({
    root: {
      margin: 0,
      padding: theme.spacing(2),
    },
    closeButton: {
      position: 'absolute',
      right: theme.spacing(1),
      top: theme.spacing(1),
      color: theme.palette.grey[500],
    },
  });
  
  const DialogTitle = withStyles(styles)((props) => {
    const { children, classes, onClose, ...other } = props;
    return (
      <MuiDialogTitle disableTypography className={classes.root} {...other}>
        <Typography variant="h6">{children}</Typography>
        {onClose ? (
          <IconButton aria-label="close" className={classes.closeButton} onClick={onClose}>
            <CloseIcon />
          </IconButton>
        ) : null}
      </MuiDialogTitle>
    );
  });
  
  const DialogContent = withStyles((theme) => ({
    root: {
      padding: theme.spacing(2),
    },
  }))(MuiDialogContent);
  
  const DialogActions = withStyles((theme) => ({
    root: {
      margin: 0,
      padding: theme.spacing(1),
    },
  }))(MuiDialogActions);
  


export default class HomepageRegisteredUser extends Component {

    constructor(props){
        super(props);
        this.handleClickOpen = this.handleClickOpen.bind(this);
        this.handleClose = this.handleClose.bind(this);
        this.handleSearch = this.handleSearch.bind(this);
        this.handleSearchVideo = this.handleSearchVideo.bind(this);
        this.onChangeSearch = this.onChangeSearch.bind(this);
        this.state={
            open:false,
            employees: [],
            ComicBooks:[],
            RomanceBooks:[],
            ActionBooks:[],
            DramaBooks:[],
            FantasyBooks:[],
            HorrorBooks:[],
            search:"",
            RomanceVideos:[],
            id:""
        };
    }

    onChangeSearch(e) {
      this.setState({
        search: e.target.value
      });
    }

    handleSearch(e){
    
        const h1=this.state.search;
        this.props.history.push(`/searchBookResult/${h1}`);
          window.location.reload();
    
    }

    handleSearchVideo(e){
    
      const h1=this.state.search;
      this.props.history.push(`/searchVideoResult/${h1}`);
        window.location.reload();
  
  }

    handleClickOpen(e) {
        this.setState({
          open: true
        });
      }
      handleClose(e) {
        this.setState({
          open: false
        });
      }


      componentDidMount(){
        let user = authService.getCurrentUser(); 
        this.state.id=user.id;
        authService.getBooks().then((res) => {
              this.setState({employees:res.data});
        });
        authService.RhomePageBooksAction().then((res) => {
          this.setState({ActionBooks:res.data});
    });
    authService.RhomePageBooksComic().then((res) => {
      this.setState({ComicBooks:res.data});
});
authService.RhomePageBooksDrama().then((res) => {
  this.setState({DramaBooks:res.data});
});
authService.RhomePageBooksFantasy().then((res) => {
  this.setState({FantasyBooks:res.data});
});
authService.RhomePageBooksRomance().then((res) => {
  this.setState({RomanceBooks:res.data});
});
authService.RhomePageBooksHorror().then((res) => {
  this.setState({HorrorBooks:res.data});
});
authService.RhomePageVideosRomance(user.id).then((res) => {
  this.setState({ RomanceVideos:res.data});
});

    }

    editEmployee(id){
      this.props.history.push(`viewSelectedBook/${id}`);
  }

    
    render() {          
            return (
                
                <div className="cards1">
            
                  <h1>Book Collection</h1>    
         <br></br><br></br>
                  <Form
             onSubmit={this.handleSearch}
             ref={c => {
               this.form = c;
             }}>
             <div>
             
            <Input
              placeholder="Search By Title, Author or Keyword"
              type="text"
              name="search"
              value={this.state.search}
              onChange={this.onChangeSearch}
              validations={[required]}
              className="searchTextField" 
            />
            
           </div>
           <button className="commentButton12" >Search</button>
           <CheckButton
            style={{ display: "none" }}
            ref={c => {
              this.checkBtn = c;
            }}/>
          
             </Form>  
      
      <div className="cards__container1">
        <div className="cards__wrapper1">
          <h2>Comic</h2>
          <ul className="cards__items1">
          
          {
            
                    this.state.ComicBooks.map(
                employee =>
          <div class="child "  >
            
            <Card style={{ width: '16rem',height:'30rem', backgroundColor:'#77b5fe' }}>
      <Card.Img variant="top" className='cardImage12' src={employee.imageOfVideo} />
      <Card.Body>
          <p style={{ fontSize:'20px',color:'white'}}><b>{employee.title}</b></p>
          <p style={{ color:'black' }}>Author :{employee.author}</p>
          <p style={{ color:'black' }}>Published  :{employee.year}</p>
          <p style={{ color:'black' }}>{employee.category}</p>
        <Button variant="primary" style={{ alignContent:'center' }}  onClick={()=>this.viewSelectedBookDetails(employee.id)}>View</Button>
      </Card.Body>
    </Card> 
            </div> 
              )
            }  
            </ul>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <h2>Action</h2>
            <ul className="cards__items1">
          {
                    this.state.ActionBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Book"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
            
            <ul className="cards__items1">
            <h2>Drama</h2>
          {
            
                    this.state.DramaBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Book"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
            <h2>Romance</h2>
            <ul className="cards__items1">
          {
                    this.state.RomanceBooks.map(
                employee =>
          <div class="child ">
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Book"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul> 
            <h2>Fantasy</h2>
            <ul className="cards__items1">
          {
                    this.state.FantasyBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Book"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>    
            <h2>Horror</h2>    
            <ul className="cards__items1">
          {
                    this.state.HorrorBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Book"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
        </div>
      
      </div>

        <h1>Video Collection</h1>
           <br></br>    
           <br></br>     
        <Form
             onSubmit={this.handleSearchVideo}
             ref={c => {
               this.form = c;
             }}>
             <div>
             
            <Input
              placeholder="Search By Title, Author or Keyword"
              type="text"
              name="search"
              value={this.state.search}
              onChange={this.onChangeSearch}
              validations={[required]}
              className="searchTextField" 
            />
            
           </div>
           <button className="commentButton12" >Search</button>
           <CheckButton
            style={{ display: "none" }}
            ref={c => {
              this.checkBtn = c;
            }}/>
          
             </Form>                
          
      
      <div className="cards__container1">
        <div className="cards__wrapper1">
          <h2>Comic</h2>
          <ul className="cards__items1">
          
          {
            
                    this.state. RomanceVideos.map(
                employee =>
          <div class="child "  >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedVideo/'+employee.id}
            /> 
       
            </div> 
              )
            }  
            </ul>
            <h2>Action</h2>
            <ul className="cards__items1">
          {
                    this.state.ActionBooks.map(
                employee =>
          <div class="child ">
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
            
            <ul className="cards__items1">
            <h2>Drama</h2>
          {
            
                    this.state.DramaBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
            <h2>Romance</h2>
            <ul className="cards__items1">
          {
                    this.state.RomanceBooks.map(
                employee =>
          <div class="child " >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul> 
            <h2>Fantasy</h2>
            <ul className="cards__items1">
          {
                    this.state.FantasyBooks.map(
                employee =>
          <div class="child "  >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedVideo/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>    
            <h2>Horror</h2>    
            <ul className="cards__items1">
          {
                    this.state.HorrorBooks.map(
                employee =>
          <div class="child "  >
            <CardItem
              src={employee.imageOfVideo}
              text={employee.title}
              label="Video"
              path={'/viewSelectedBook/'+employee.id}
            />   
            </div> 
              )
            }  
            </ul>
        </div>
      
      </div>
                                
    
    </div>
   
              )                  
    }
}
